import React, { useState, useEffect } from 'react';
import '../styles/Navbar.css';
import { Link } from 'react-router-dom';
import { FiHome, FiSearch, FiUser, FiInfo, FiLogIn } from 'react-icons/fi';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);
  const [activeLink, setActiveLink] = useState('home');

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 10);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);
  const closeMenu = () => setIsMenuOpen(false);

  // Close mobile menu when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (isMenuOpen && 
          !event.target.closest('.navbar-links') && 
          !event.target.closest('.menu-toggle')) {
        setIsMenuOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, [isMenuOpen]);

  // Prevent body scroll when mobile menu is open
  useEffect(() => {
    if (isMenuOpen) {
      document.body.style.overflow = 'hidden';
    } else {
      document.body.style.overflow = 'auto';
    }
    return () => {
      document.body.style.overflow = 'auto';
    };
  }, [isMenuOpen]);

  return (
    <nav className={`navbar ${scrolled ? 'scrolled' : ''}`}>
      <div className="navbar-content">
        <div className="navbar-logo">
          <span className="navbar-logo-icon"></span>
          Chalets Suisses
        </div>

        <div 
          className={`menu-toggle ${isMenuOpen ? 'active' : ''}`} 
          onClick={toggleMenu}
          aria-label="Toggle menu"
        >
          <span></span>
          <span></span>
          <span></span>
        </div>

        <ul className={`navbar-links ${isMenuOpen ? 'active' : ''}`}>
          <li>
            <a 
              href="#home" 
              className={activeLink === 'home' ? 'active' : ''}
              onClick={() => {
                setActiveLink('home');
                closeMenu();
              }}
            >
              <FiHome /> Home
            </a>
          </li>
          <li>
            <a 
              href="#buy" 
              className={activeLink === 'buy' ? 'active' : ''}
              onClick={() => {
                setActiveLink('buy');
                closeMenu();
              }}
            >
              <Link to="/properties" className="view-all">
                 <FiSearch /> Buy Chalets         
              </Link>
              
            </a>
          </li>
          <li>
            <a 
              href="#rent" 
              className={activeLink === 'rent' ? 'active' : ''}
              onClick={() => {
                setActiveLink('rent');
                closeMenu();
              }}
            >
              <FiSearch /> Rent Chalets
            </a>
          </li>
          <li>
            <a 
              href="#about" 
              className={activeLink === 'about' ? 'active' : ''}
              onClick={() => {
                setActiveLink('about');
                closeMenu();
              }}
            >
              <FiInfo /> About Us
            </a>
          </li>
          <li>
            <a 
              href="#contact" 
              className={activeLink === 'contact' ? 'active' : ''}
              onClick={() => {
                setActiveLink('contact');
                closeMenu();
              }}
            >
              <FiUser /> Contact
            </a>
          </li>

          <div className="navbar-auth">
            <a href="#login" className="login-btn" onClick={closeMenu}>
              <FiLogIn /> Login / Sign Up
            </a>
          </div>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
